define({"topics" : [{"title":"Enabling the Android adb command","shortdesc":"\n                                 <p class=\"shortdesc\"><span class=\"ph filepath\">Remote TestKit</span> provides standard adb (Android Debug Bridge)         functionality to enable the use of <span class=\"keyword cmdname\">adb</span> commands to access remote devices.         This is the equivalent of having a smartphone device connected directly to your\n                                    computer via         USB.\n                                 </p>\n                              ","id":"task_e4j_p5z_15","href":"TA_Automation\/Topics\/aut_app_cloud_testing_Android_adb.html","menu": {"hasChildren":false,},"tocID":"task_e4j_p5z_15-d46e46263","topics":[]},{"title":"Installing TestArchitect Agent","shortdesc":"\n                                 <p class=\"shortdesc\">TestArchitect Agent is an essential component in allowing TestArchitect to         communicate with Chrome, WebView, or native\n                                    applications running on a cloud Android device         during automated testing.\n                                 </p>\n                              ","id":"task_td5_y5z_15","href":"TA_Automation\/Topics\/aut_app_cloud_testing_Android_agent.html","menu": {"hasChildren":false,},"tocID":"task_td5_y5z_15-d46e46279","topics":[]},{"title":"Installing a testable AUT on an Android cloud device","shortdesc":"\n                                 <p class=\"shortdesc\">Installing an AUT on a target cloud device for testing purposes is a two-step process   which involves re-signing and installing\n                                    the application.\n                                 </p>\n                              ","id":"concept_k32_5c1_b5","href":"TA_Automation\/Topics\/aut_app_cloud_testing_install_AUT_app.html","menu": {"hasChildren":false,},"tocID":"concept_k32_5c1_b5-d46e46290","next":"concept_k32_5c1_b5-d46e46290",}]});